/* eslint-disable no-unused-vars */
import {useState} from 'react';
const Home = () => {

    const [count, setCount] = useState(1);
    const [blogs, setBlogs] = useState([
        {title:'Entry No. 7', url:'asd.awds', id:1},
        {title:'A Rift In Time', url:'efsdf.asd', id:2},
        {title:'Pachinko', url:'asdasd.asd', id:3}
    ]);
    const event = () => {
        setCount(blogs.length);
    }
    
    return ( 
        <div className="home">
            <h2>Homepage - Drawings</h2>
            <button onClick={event}>Click here to add latest drawings.</button>
            <br />
            <p>Drawings displayed: {count}</p>
            <br />
            {blogs.map((blog) => (
                <div className="drawing" key={blog.id}>
                    <h3>{blog.title}</h3>
                    <p>Link: {blog.url}</p>
                </div>
            ))}
        </div>
     );
}
 
export default Home;
